NetWork = {
    baseUrl: null,
    //1cmd
    //2js{}
    //3serverData(object)
    request: function (cmd, bizdata, callback) {
        if (NetWork.baseUrl == null) {
            //urlurl
            NetWork.baseUrl = window.location.origin;
            if (NetWork.baseUrl.indexOf(".h5.") == -1) {
                // .h5. appid
                NetWork.baseUrl = NetWork.baseUrl + "/" + window.APPID;
            }
        }

        $.ajax({
            type: 'POST',
            url: NetWork.baseUrl + "/" + cmd,
            data: {
                bizData: bizdata
            },
            success: function (serverData) {
                callback(serverData);
            },
            error: function () {
                callback(null);
            }
        });

    }
};
